var noPhotoImg = "/img/no_photo.png";

function sendSingleCriteoTransaction(params) {
    if (!params.account) {
        params.account = 49830;
    }

    if (!params.mail) {
        params.mail = '';
    }

    if (!params.transactionId) {
        return false;
    }

    if (!params.productId) {
        params.productId = 'p1';
    }

    if (!params.productPrice) {
        params.productPrice = 1;
    }

    if (!params.productQuantity) {
        params.productQuantity = 1;
    }

    window.criteo_q = window.criteo_q || [];
    var deviceType = /iPad/.test(navigator.userAgent) ? "t" : /Mobile|iP(hone|od)|Android|BlackBerry|IEMobile|Silk/.test(navigator.userAgent) ? "m" : "d";
    window.criteo_q.push(
        {event: "setAccount", account: params.account}, //    
        {event: "setEmail", email: params.mail}, //    
        {event: "setSiteType", type: deviceType},
        {
            event: "trackTransaction", id: params.transactionId, item: [
                {id: params.productId, price: params.productPrice, quantity: params.productQuantity}
            ]
        }
    );
}

function send_uform_design_request_kitchen(data, statusText, xhr, $form) {

    $form.find(".send-btn").removeAttr('disabled');
    $form.find(".field-error").removeClass('field-error');

    if (data.status == 'ok') {

        if ($form.attr('data-metrika-goal')) {
            console.log($form.attr('data-metrika-goal'));
            if (typeof yaCounter31874381 !== 'undefined') {
                yandexReachGoal($form.attr('data-metrika-goal'));
            }
        }
        if ($form.attr('data-ga-goal')) {
            console.log($form.attr('data-ga-goal'));
            if (typeof ga !== 'undefined') {
                ga('send', 'event', $form.attr('data-ga-goal'), 'click');
            }
        }
        if ($form.attr('data-analytics-category')) {
            if (typeof ga !== 'undefined') {
                ga('send', 'event', $form.attr('data-analytics-category'), $form.attr('data-analytics-action'));
            }
        }

        $form.trigger('reset');

        var href = $form.attr('data-href');
        if (href) {
            $.arcticmodal('close');
            openPopup(href);
        } else {
            $('.uform_popup_inner').html(data.message).show();
            show_uform();
            window.setTimeout('hide_popup();', 5000);
        }

    } else if (data.err !== undefined) {

        for (i = 0; i < data.err.length; i++) {
            $(data.err[i][0]).addClass('field-error').find('span.err').html(data.err[i][1]);
        }
    }

    if (data.captcha !== undefined) {
        $form.find('img.uform-captcha-img').attr('src', data.captcha.img);
        $form.find('input[name="CAPTCHA[SID]"]').val(data.captcha.sid);
    }

}

$(function () {

    var formFileReader = $(".js-form-FileReader");

    formFileReader.on('click', '.js-test-popup__photo-block-add-more', function (e) {
        e.preventDefault();
        $(this).siblings('input[type="file"]').last().trigger('click');
    });

    formFileReader.on('click', '.js-test-popup__photo-block-item-close', function (e) {
        e.preventDefault();
        var num = $(this).data('num');
        formFileReader.find('.js-input-file-' + num).remove();
        formFileReader.find('.js-input-file-block-' + num).remove();
    });

    formFileReader.on('change', '.design-request-popup_file_input', function () {
        var file = this.files[0];
        var reader = new FileReader();
        var filesBlock = $(this).siblings('.test-popup__photo-block-list');
        var addedFileHtml = '\
                        <div class="test-popup__photo-block-item js-input-file-block-{num}">\
                            <div class="test-popup__photo-block-item-img js-input-file-img-{num}"></div>\
                            <div class="test-popup__photo-block-item-text">\
                                <p class="test-popup__photo-block-item-name">' + file.name + '</p>\
                                <p class="test-popup__photo-block-item-size">' + (file.size / 1024 / 1024).toFixed(2) + '</p>\
                            </div>\
                            <a href="#" class="test-popup__photo-block-item-close js-test-popup__photo-block-item-close"\
                             data-num="{num}"></a>\
                        </div>';

        var filesBlocksNumber = filesBlock.find('.test-popup__photo-block-item').length,
            addedFilesNumber = Number(formFileReader.find('.test-popup__photo-block').data('files-number'));

        addedFileHtml = addedFileHtml.replace(/\{num\}/g, addedFilesNumber);

        if (filesBlocksNumber === 0) {
            filesBlock.html(addedFileHtml);
        } else {
            filesBlock
                .find('.test-popup__photo-block-item')
                .last()
                .after(addedFileHtml);
        }

        var newInput = $(this).clone();
        newInput.removeClass('js-input-file-' + addedFilesNumber);
        var nextNum = addedFilesNumber + 1;
        formFileReader.find('.test-popup__photo-block').data('files-number', nextNum);
        newInput.addClass('js-input-file-' + nextNum);
        newInput.addClass('js-input-file');

        $(this).after(newInput);

        reader.addEventListener("load", function () {

            var backgroundImageFile = reader.result;
            if (reader.result.indexOf("data:image") === -1) {
                backgroundImageFile = noPhotoImg;
            }

            formFileReader.find('.js-input-file-img-' + addedFilesNumber).css('background-image', 'url("' + backgroundImageFile + '")');
        }, false);

        if (file) {
            reader.readAsDataURL(file);
        }
    });


});



