(function(){
    $('document').ready(function(){
        if($('.custom-countdown').length){
            function num2str(n, variants) {
                n = Math.abs(n) % 100; var n1 = n % 10;
                if (n > 10 && n < 20) { return variants[2]; }
                if (n1 > 1 && n1 < 5) { return variants[1]; }
                if (n1 == 1) { return variants[0]; }
                return variants[2];
            }

            function updateCustomCountdown() {
                var daysVariants = ['', '', ''],
                    hoursVariants = ['', '', ''],
                    minutesVariants = ['', '', ''];

                var textDate = $('.custom-countdown').data('end'),
                    endTime = new Date(textDate.replace(/(\d+).(\d+).(\d+)/, '$3/$2/$1')).getTime(),
                    curTime = new Date().getTime(),
                    difTime = endTime - curTime;

                var tdays = Math.floor(difTime / (1000 * 60 * 60 * 24)),
                    thours = Math.floor((difTime % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60)),
                    tminutes = Math.floor((difTime % (1000 * 60 * 60)) / (1000 * 60));

                var days = (tdays < 10) ? '0' + tdays : tdays,
                    hours = (thours < 10) ? '0' + thours : thours,
                    minutes = (tminutes < 10) ? '0' + tminutes : tminutes;

                $('.custom-countdown__time_days').find('.custom-countdown__number').text(days);
                $('.custom-countdown__time_days').find('.custom-countdown__description').text(num2str(days, daysVariants));

                $('.custom-countdown__time_hours').find('.custom-countdown__number').text(hours);
                $('.custom-countdown__time_hours').find('.custom-countdown__description').text(num2str(hours, hoursVariants));

                $('.custom-countdown__time_minutes').find('.custom-countdown__number').text(minutes);
                $('.custom-countdown__time_minutes').find('.custom-countdown__description').text(num2str(minutes, minutesVariants));
            }

            updateCustomCountdown();
            setInterval(updateCustomCountdown, 1000);
        }

        $('.custom-sticky-banner').on('click', function(e){
            if($(e.target).hasClass('custom-sticky-banner__close') || $(e.target).parents('.custom-sticky-banner__close').length){
                $('.custom-sticky-banner').hide();
                $('.blocks-wrapper').removeClass('has-sticky-banner');

                document.cookie = "stickyPopupClose=1; path=/; max-age=54000";
            } else if($('.custom-sticky-banner').data('url') != undefined && $('.custom-sticky-banner').data('url') != '' ) {
                location.href = $('.custom-sticky-banner').data('url');
            }

            return false;
        });

        if($('.custom-sticky-banner').length) {
            $('.blocks-wrapper').addClass('has-sticky-banner');
        }
    });
})();
