$(function(){
	$('body').append('<div id="uform_overlay">&nbsp;</div>\
	<div class="uform_popup">\
	<a href="#" class="button_close" onclick="hide_popup(); return false;"></a>\
	<div class="preloader"><img src="/local/components/custom/uform.form/templates/.default/images/preloader.gif"  /></div>\
	<div class="uform_popup_inner"></div>\
	</div>');

    $('#design-request-popup').on('click', '.js-test-popup__photo-block-add-more', function (e) {
        e.preventDefault();
        $(this).siblings('input[type="file"]').last().trigger('click');
    });

    $('#design-request-popup').on('click', '.js-test-popup__photo-block-item-close', function (e) {
        e.preventDefault();
        var num = $(this).data('num');
        $('.js-input-file-' + num).remove();
        $('.js-input-file-block-' + num).remove();
    });

    $('#design-request-popup').on('change', '.design-request-popup_file_input', function () {
        var file    = this.files[0];
        var reader  = new FileReader();
        var filesBlock = $(this).siblings('.test-popup__photo-block-list');
        var addedFileHtml = '\
                    <div class="test-popup__photo-block-item js-input-file-block-{num}">\
                        <div class="test-popup__photo-block-item-img js-input-file-img-{num}"></div>\
                        <div class="test-popup__photo-block-item-text">\
                            <p class="test-popup__photo-block-item-name">' + file.name + '</p>\
                            <p class="test-popup__photo-block-item-size">' + (file.size / 1024 / 1024).toFixed(2) + '</p>\
                        </div>\
                        <a href="#" class="test-popup__photo-block-item-close js-test-popup__photo-block-item-close"\
                         data-num="{num}"></a>\
                    </div>';

        var filesBlocksNumber = filesBlock.find('.test-popup__photo-block-item').length,
            addedFilesNumber = Number($('.test-popup__photo-block').data('files-number'));

        addedFileHtml = addedFileHtml.replace(/\{num\}/g, addedFilesNumber);

        if (filesBlocksNumber === 0) {
            filesBlock.html(addedFileHtml);
        } else {
            filesBlock
                .find('.test-popup__photo-block-item')
                .last()
                .after(addedFileHtml);
        }

        var newInput = $(this).clone();
        newInput.removeClass('js-input-file-' + addedFilesNumber);
        var nextNum = addedFilesNumber + 1;
        $('.test-popup__photo-block').data('files-number', nextNum);
        newInput.addClass('js-input-file-' + nextNum);
        $(this).after(newInput);

        reader.addEventListener("load", function () {
            $('.js-input-file-img-' + addedFilesNumber).css('background-image', 'url("'+reader.result+'")');
        }, false);

        if (file) {
            reader.readAsDataURL(file);
        }
    });


});

